package PROBLEMS.Problems12;

public class Main {

    static String makeFancyString(String s) {
        int count = 1;
        StringBuilder tempStr = new StringBuilder();
        for (int i = 0; i < s.length(); i++) {
            if (i != 0 && s.charAt(i - 1) == s.charAt(i)) {
                count++;
            } else {
                count = 1;
            }
            if (count >= 3) {
                tempStr.append(s.substring(i, i + 1).replace(s.charAt(i), ' '));
                continue;
            }
            tempStr.append(s.charAt(i));
        }
        s = tempStr.toString();
        s = s.replace(" ", "");
        return s;
    }

    public static void main(String[] args) {
        String s = "";
        System.out.println(makeFancyString(s));

    }
}
